import React, { useState, useRef, useEffect } from 'react';
import { 
  MessageCircle, 
  Send, 
  Plus, 
  Loader, 
  Moon, 
  Sun, 
  Settings, 
  PlusCircle
} from 'lucide-react';

import './App.css';

export default function App() {
  const [messages, setMessages] = useState([]);
  const [query, setQuery] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [chats, setChats] = useState([]);
  const messagesEndRef = useRef(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
    // Apply dark mode to body
    document.body.classList.toggle('dark-mode', isDarkMode);
  }, [messages, isDarkMode]);

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!query.trim()) return;

    setMessages(prev => [...prev, { text: query, sender: 'user' }]);
    setQuery('');
    setIsLoading(true);

    try {
      const response = await fetch(`http://localhost:8000/search?query=${query}`);
      const data = await response.json();
      setTimeout(() => {
        setMessages(prev => [...prev, { text: data.message || "I'm here to help!", sender: 'bot' }]);
        setIsLoading(false);
      }, 500);
    } catch (error) {
      console.error('Error:', error);
      setIsLoading(false);
    }
  };

  const startNewChat = () => {
    setMessages([]);
    setChats(prev => [
      { id: Date.now(), title: 'New Chat', active: true },
      ...prev.map(chat => ({ ...chat, active: false }))
    ]);
  };

  return (
    <div className={`app-container ${isDarkMode ? 'dark-theme' : ''}`}>
      {/* Sidebar */}
      <div className="sidebar">
        <div className="sidebar-header">
          <button className="new-chat-button" onClick={startNewChat}>
            <PlusCircle className="w-4 h-4 mr-2" /> New chat
          </button>
        </div>

        <div className="chats-list">
          {chats.map(chat => (
            <div key={chat.id} className={`chat-item ${chat.active ? 'active' : ''}`}>
              <MessageCircle className="w-4 h-4 mr-2" />
              {chat.title}
            </div>
          ))}
        </div>

        <div className="sidebar-footer">
          <button 
            className="theme-toggle"
            onClick={() => setIsDarkMode(!isDarkMode)}
          >
            {isDarkMode ? (
              <Sun className="w-5 h-5" />
            ) : (
              <Moon className="w-5 h-5" />
            )}
          </button>
          <button className="settings-button">
            <Settings className="w-5 h-5" />
          </button>
        </div>
      </div>

      {/* Main Chat Area */}
      <div className="chat-container">
        <div className="chat-header">
          <div className="header-content">
            <MessageCircle className="text-blue-500 w-8 h-8 mr-3 animate-pulse" />
            <h1 className="app-title">Nutino Rag</h1>
          </div>
          <div className="header-pills">
            <span className="status-pill">AI powered</span>
            <span className="feature-pill">Nooglers Built</span>
          </div>
        </div>

        <div className="messages-container">
          {messages.map((message, index) => (
            <div
              key={index}
              className={`message-wrapper ${message.sender === 'user' ? 'user-message' : 'bot-message'}`}
            >
              <div className="message-content">
                {message.text}
              </div>
              <div className="message-timestamp">
                {new Date().toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}
              </div>
            </div>
          ))}
          {isLoading && (
            <div className="bot-message">
              <div className="typing-indicator">
                <span></span>
                <span></span>
                <span></span>
              </div>
            </div>
          )}
          {messages.length === 0 && (
            <div className="empty-state">
              {/* Heartbeat Lines Animation */}
              <div className="heartbeat-lines">
                <div className="line"></div>
                <div className="line"></div>
                <div className="line"></div>
              </div>

              <div className="empty-state-icon">
                <Plus className="w-12 h-12 text-blue-400" />
              </div>
              <h3>Start Your Medical Consultation</h3>
              <p>Ask any medical question to get started</p>
            </div>
          )}
          <div ref={messagesEndRef} />
        </div>

        <form onSubmit={handleSearch} className="input-container">
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="Type your medical question..."
            className="message-input"
          />
          <button
            type="submit"
            className="send-button"
            disabled={isLoading || !query.trim()}
          >
            {isLoading ? (
              <Loader className="w-5 h-5 animate-spin" />
            ) : (
              <Send className="w-5 h-5" />
            )}
          </button>
        </form>
      </div>
    </div>
  );
}
